import React from 'react';
import { useEffect } from 'react';

import NavigationBar from '../components/NavigationBar';
import Mastfoot from '../components/mastfoot';
import bg from '../static/images/cover_blur.jpg';
import bio from '../static/images/bio.jpg'

function About () {

  return (
  <div className="site-wrapper">
    <div className="site-wrapper-inner">
      <div className="cover-container">

        <NavigationBar active_page='About' />


            <div className='row'> 
              <div className="block">

                <img src={bio} className="bio" alt="bio" />
              </div>


              <div className="block">
                <div className="connect">
                <h1>Let's connect. </h1>
                <p> I'm open to new projects in software engineering,
                AI research, music technology, or education. </p>
                </div>

            </div>
        </div>
        <Mastfoot />
      </div>
    </div>
  </div>


    );

  };

  export default About;
